{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002', 'repository_url': 'https://api.github.com/repos/spring-projects/spring-framework', 'labels_url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002/comments', 'events_url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002/events', 'html_url': 'https://github.com/spring-projects/spring-framework/issues/28002', 'id': 1123479707, 'node_id': 'I_kwDOABGHUc5C9vCb', 'number': 28002, 'title': 'Add inverse of the @DependsOn annotation', 'user': {'login': 'jxblum', 'id': 5247119, 'node_id': 'MDQ6VXNlcjUyNDcxMTk=', 'avatar_url': 'https://avatars.githubusercontent.com/u/5247119?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/jxblum', 'html_url': 'https://github.com/jxblum', 'followers_url': 'https://api.github.com/users/jxblum/followers', 'following_url': 'https://api.github.com/users/jxblum/following{/other_user}', 'gists_url': 'https://api.github.com/users/jxblum/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/jxblum/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/jxblum/subscriptions', 'organizations_url': 'https://api.github.com/users/jxblum/orgs', 'repos_url': 'https://api.github.com/users/jxblum/repos', 'events_url': 'https://api.github.com/users/jxblum/events{/privacy}', 'received_events_url': 'https://api.github.com/users/jxblum/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 1188511944, 'node_id': 'MDU6TGFiZWwxMTg4NTExOTQ0', 'url': 'https://api.github.com/repos/spring-projects/spring-framework/labels/status:%20declined', 'name': 'status: declined', 'color': 'fef2c0', 'default': False, 'description': "A suggestion or change that we don't feel we should currently apply"}, {'id': 1188512000, 'node_id': 'MDU6TGFiZWwxMTg4NTEyMDAw', 'url': 'https://api.github.com/repos/spring-projects/spring-framework/labels/in:%20core', 'name': 'in: core', 'color': 'e8f9de', 'default': False, 'description': 'Issues in core modules (aop, beans, core, context, expression)'}, {'id': 1188512010, 'node_id': 'MDU6TGFiZWwxMTg4NTEyMDEw', 'url': 'https://api.github.com/repos/spring-projects/spring-framework/labels/type:%20enhancement', 'name': 'type: enhancement', 'color': 'e3d9fc', 'default': False, 'description': 'A general enhancement'}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 4, 'created_at': '2022-02-03T19:37:44Z', 'updated_at': '2022-04-15T18:36:37Z', 'closed_at': '2022-02-15T15:22:20Z', 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': 'This is a new feature request to add a new annotation (and capability) to the core Spring Framework that has the opposite effect of the `@DependsOn` annotation ([Javadoc](https://docs.spring.io/spring-framework/docs/current/javadoc-api/org/springframework/context/annotation/DependsOn.html)).

With Spring's `@DependsOn` annotation users can say bean B depends on bean A, like so:

````java
@Configuration
class MyApplicationConfiguration {

  @Bean("B")
  @DependsOn("A")
  B bBean() {
    return new B();
  }

  @Bean("A")
  A aBean(..) {
    return new A();
  }
}
````

The new, inverse annotation, which I have dubbed `@DependencyOf`, exists in the _**Spring Test for Apache Geode**_ (STDG) project; see [here](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/main/java/org/springframework/data/gemfire/tests/extensions/spring/context/annotation/DependencyOf.java).

The equivalent effect using `@DependencyOf` is the following configuration:

````java
@Configuration
class MyApplicationConfiguration {

  @Bean("A")
  @DependencyOf("B")
  A aBean(..) {
    return new A();
  }

  @Bean("B")
  B bBean() {
    return new B();
  }
}
````

While this is not very useful in this particular configuration arrangement, it is merely to demonstrate the effect.  So, when would `@DependencyOf` be useful?

The need for this new `@DependencyOf` annotation came about in testing.

I use the STDG project to consistently and reliably test across _Spring Data for Apache Geode_ (SDG), _Spring Session for Apache Geode_ (SSDG) and _Spring Boot for Apache Geode_ (SBDG).  In certain [test] cases, I need beans / components from SDG, SSDG or SBDG to depend on STDG components for testing purposes. Clearly SDG, SSDG and SBDG production components cannot be made to "depend on" STDG test components only used during test runtime.

You can see an example of the `@DependencyOf` annotation in action in this STDG [test class](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/test/java/org/springframework/data/gemfire/tests/CacheLifecycleListenerIntegrationTests.java).  In a nutshell, a `TestCacheLifecycleListener` [component](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/test/java/org/springframework/data/gemfire/tests/CacheLifecycleListenerIntegrationTests.java#L120-L134) and [bean](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/test/java/org/springframework/data/gemfire/tests/CacheLifecycleListenerIntegrationTests.java#L114-L117) is a ["_dependency of_](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/test/java/org/springframework/data/gemfire/tests/CacheLifecycleListenerIntegrationTests.java#L121)" the "_gemfireCache_" bean which is created in SDG by the declaration of the `ClientCacheApplication` annotation in the configuration ([here](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/test/java/org/springframework/data/gemfire/tests/CacheLifecycleListenerIntegrationTests.java#L111)). 

> NOTE: The SDG `@ClientCacheApplication` annotation responsible for creating a `GemFireCache` bean is also meta-annotated with Spring's `@Configuration` annotation making the `TestConfiguration` class a proper Spring JavaConfig class.

Of course, 1 way this might be accomplished is by having STDG components implement the `[Smart]Lifecycle` interface.  However, this is problematic for 2 reasons 1) SDG, SSDG or SBDG also has `SmartLifecycle` implementations with a potentially higher precedence and 2) the precedence of `SmartLifecycle` components in SDG, SSDG and SBDG could change in the future and become higher.  There are other situations to consider.

There are of course hooks in the _Spring_ `TestContext` framework where it might be possible to perform certain initialization in `TestExecutionListeners` and what not.  I have considered multiple angles here.

Yet another implementation would be to use a `BeanFactoryPostProcessor` to change the dependencies of the SDG, SSDG and SBDG bean definitions.

And, in fact, this is exactly how the `@DependencyOf` annotation configuration is implemented, by using a `BeanFactoryPostProcessor` to modify the (would be) dependent beans / components from upstream frameworks.  See [here](https://github.com/spring-projects/spring-test-data-geode/blob/0.0.28/spring-data-geode-test/src/main/java/org/springframework/data/gemfire/tests/extensions/spring/context/annotation/DependencyOfBeanFactoryPostProcessor.java).

The `@DependencyOf` annotation is flexible and easy to add to any (downstream) project that might require beans to get initialized before the upstream framework initializes certain beans.

I am proposing this additional, complimentary annotation as an addition to the core Spring Framework if the team feels this would have value (merit) beyond the use cases I identified. I would be happy to work with interested parties on its integration as needed.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002/reactions', 'total_count': 2, '+1': 2, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/comments/1100283640', 'html_url': 'https://github.com/spring-projects/spring-framework/issues/28002#issuecomment-1100283640', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/28002', 'id': 1100283640, 'node_id': 'IC_kwDOABGHUc5BlP74', 'user': {'login': 'jxblum', 'id': 5247119, 'node_id': 'MDQ6VXNlcjUyNDcxMTk=', 'avatar_url': 'https://avatars.githubusercontent.com/u/5247119?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/jxblum', 'html_url': 'https://github.com/jxblum', 'followers_url': 'https://api.github.com/users/jxblum/followers', 'following_url': 'https://api.github.com/users/jxblum/following{/other_user}', 'gists_url': 'https://api.github.com/users/jxblum/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/jxblum/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/jxblum/subscriptions', 'organizations_url': 'https://api.github.com/users/jxblum/orgs', 'repos_url': 'https://api.github.com/users/jxblum/repos', 'events_url': 'https://api.github.com/users/jxblum/events{/privacy}', 'received_events_url': 'https://api.github.com/users/jxblum/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-15T18:36:37Z', 'updated_at': '2022-04-15T18:36:37Z', 'author_association': 'MEMBER', 'body': 'Hi @agoston - Thank you for your continued interests in this feature. I am planning to break this out into a separate library along with many other Spring Framework (and other Spring project, e.g. Spring Boot) extensions I have developed in my specific Spring projects over the years.  I have no planned timeframe yet for doing so.

I will give this more thought and post back here soon when I have some concrete details.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-framework/issues/comments/1100283640/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

